import styles from './styles/sideMenu.module.css'

function SideMenu ({clicked}) {
    return (
        <div className={`${clicked ? "absolute transform -left-0 transition-all ease-out duration-500": "-translate-y-full "} absolute top-0 h-full w-11/12 bg-white`}>
            <h1>Side Menu</h1>
        </div>
    )
}

export default SideMenu
